const tasksList = ['estudar', 'desenhar', 'ver série', 'jogar'];

const Task = (array) => {
  return (
    array.map((task) => console.log(task))
  );
}

function App() {
  return (
    <ul>
      {Task(tasksList)}
    </ul>
  );
}

export default App;
